INSERT INTO `v9_block` VALUES('4','1','侧边栏联系方式','about','1','<div class=\"lianxi\" style=\"background:#eeeeee;padding:10px;line-height:150%;\">中信蓝海服务热线：<br />\r\n<br />\r\n<span style=\"color:red;\">029-68206165(总机)</span><br />\r\n<br />\r\n传 真：029-68206165<br />\r\n<br />\r\n地址：西安曲江新区雁南五路1868号曲江影视大厦10层<br />\r\n&nbsp;</div>','');
INSERT INTO `v9_block` VALUES('5','1','中信简介','zh','1','<p style=\"float: left; margin-right: 30px; width: 209px; text-align: center;\"><img src=\"http://www.zxlh.asia/uploadfile/2016/1014/20161014044934406.jpg\" style=\"width: 209px; height: 278px;\" />执行总裁：郭春洋</p>\r\n<p>陕西省中信蓝海工程项目管理有限公司，成立于2016年8月，注册资本1000万元。办公地址位于西安市曲江新区曲江影视大厦10层。西安曲江是中西部地区投资环境最好、文化产业最发达和经济发展最为活跃的区域。</p>\r\n<p>公司主营业务有工程项目管理，工程监理，工程造价咨询，建筑设计，室内装饰设计，工程招投标报告的编制及审核，政府采购项目招标代理等。</p>\r\n<p>公司旗下分设项目管理西安区域、延安区域、榆林区域分公司，及同乘（中信）工程咨询设计公司。</p>\r\n<p>公司自成立以来始终以&ldquo;为中国建设工程贡献全部力量&rdquo;为企业使命；以&ldquo;专业、规范、周全&rdquo;为企业核心价值；以&ldquo;自律、热情、专注、高效&rdquo;为执业理念；以&ldquo;品质彰显人品，人品创造品质&rdquo;为品质理念；以&ldquo;尽力努力使我们一丝不苟的完成工作，热情专注使我们忘乎所以做到极致&rdquo;为工作理念；以&ldquo;自始至终以客户为中心是我们一贯宗旨，设身处地为客户去想是我们永恒的追求&rdquo;为服务理念，为建设美丽新中国、新陕西贡献全部力量。 &nbsp;&nbsp;</p>\r\n<br />\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"http://www.zxlh.asia/uploadfile/2016/1017/20161017101137952.jpg\" style=\"width: 920px; height: 376px;\" /></p>','');
