INSERT INTO `v9_category` VALUES('234','1','content','0','1','206','0,104,206','0','234','支部简介','','','','        中共榆林青年创业管理咨询有限公司支部委员（前身为中共华春建设工程项目管理有限责任公司定边分公司支部委员）成立于2010年10月。目前下设专业党小组9个，有党员37人，其中预备党员4人、女党员19人。公司工会、团委、妇委群团组织健全，172名职工分别加入到了党、工、青、妇组织，平均年龄27岁，是一支富有朝气的年轻党建群体。\r\n        自党群组织成立以来，在支部书记郭春河的带领下，提出了“青春党建引领青年创业”的党建核心，抓住公司全员青年特点，不断将党群组织建设和公司发展深度融合，形成了“1316”青春党建模式，有力推动了非公党组织发挥实质性作用，实现了“党建建在产业链，党群工作全覆盖”的全新工作局面。','Party Building/Youth/','zbjj','http://www.zxlh.asia/index.php?m=content&c=index&a=lists&catid=234','5','0','{\"workflowid\":\"\",\"ishtml\":\"0\",\"content_ishtml\":\"0\",\"create_to_html_root\":\"0\",\"template_list\":\"default\",\"category_template\":\"category\",\"list_template\":\"list_five\",\"show_template\":\"show_newbetter\",\"meta_title\":\"\",\"meta_keywords\":\"\",\"meta_description\":\"\",\"presentpoint\":\"1\",\"defaultchargepoint\":\"0\",\"paytype\":\"0\",\"repeatchargedays\":\"1\",\"category_ruleid\":\"6\",\"show_ruleid\":\"16\"}','234','1','0','zhibujianjie','');
